import { useParams } from "react-router-dom";
import App from "./App";

function DogDetails() {
  const params = useParams();

  const dogArr = App.defaultProps.dogs;

  const dogRender = dogArr.map((dog) => {
    if (params.name.toUpperCase() === dog.name.toUpperCase()) return <></>;
  });

  return (
    <div>
      <p>{}</p>
    </div>
  );
}

export default DogDetails;
